import React from "react";
import { NavigationContainer } from "@react-navigation/native";
import { createStackNavigator } from "@react-navigation/stack";

import Home from "./Home";
import BDScreen from "./BDScreen";
import BRScreen from "./BRScreen";
import Persegi from "./Persegi";
import LuasPersegi from "./LuasPersegi";
import KelilingPersegi from "./KelilingPersegi";
import PersegiPanjang from "./PersegiPanjang";
import LuasPP from "./LuasPP";
import KelilingPP from "./KelilingPP";
import Segitiga from "./Segitiga";
import LuasSegitiga from "./LuasSegitiga";
import KelilingSegitiga from "./KelilingSegitiga";
import JajarGenjang from "./JajarGenjang";
import LuasJG from "./LuasJG"
import KelilingJG from "./KelilingJG"
import Trapesium from "./Trapesium";
import LuasTrapesium from "./LuasTrapesium";
import KelilingTrapesium from "./KelilingTrapesium";
import Lingkaran from "./Lingkaran";
import LuasLingkaran from "./LuasLingkaran";
import KelilingLingkaran from "./KelilingLingkaran";
import Kubus from "./Kubus";
import VolumeKubus from "./VolumeKubus";
import LPKubus from "./LPKubus";
import Balok from "./Balok";
import VolumeBalok from "./VolumeBalok";
import LPBalok from "./LPBalok";
import Tabung from "./Tabung";
// import VolumeTabung from "./VolumeTabung";
// import LPTabung from "./LPTabung";
import Kerucut from "./Kerucut";
// import VolumeKerucut from "./VolumeKerucut";
// import LPKerucut from "./LPKerucut"
import Bola from "./Bola";
// import VolumeBola from "./VolumeBola";
// import LPBola from "./LPBola";

const App = ({ navigation }) => {
  const Stack = createStackNavigator();
  return (
    <NavigationContainer>
      <Stack.Navigator initialRouteName="Home">
        <Stack.Screen
          name="Home"
          component={Home}
          options={{ headerShown: false }}
        />
        <Stack.Screen
          name="BDScreen"
          component={BDScreen}
          options={{ headerShown: false }}
        />
        <Stack.Screen
          name="BRScreen"
          component={BRScreen}
          options={{ headerShown: false }}
        />
        <Stack.Screen
          name="Persegi"
          component={Persegi}
          options={{ headerShown: false }}
        />
        <Stack.Screen
          name="LuasPersegi"
          component={LuasPersegi}
          options={{ headerShown: false }}
        />
        <Stack.Screen
          name="KelilingPersegi"
          component={KelilingPersegi}
          options={{ headerShown: false }}
        />
        <Stack.Screen
          name="PersegiPanjang"
          component={PersegiPanjang}
          options={{ headerShown: false }}
        />
        <Stack.Screen
          name="LuasPP"
          component={LuasPP}
          options={{ headerShown: false }}
        />
        <Stack.Screen
          name="KelilingPP"
          component={KelilingPP}
          options={{ headerShown: false }}
        />
        <Stack.Screen
          name="Segitiga"
          component={Segitiga}
          options={{ headerShown: false }}
        />
        <Stack.Screen
          name="LuasSegitiga"
          component={LuasSegitiga}
          options={{ headerShown: false }}
        />
        <Stack.Screen
          name="KelilingSegitiga"
          component={KelilingSegitiga}
          options={{ headerShown: false }}
        />
        <Stack.Screen
          name="JajarGenjang"
          component={JajarGenjang}
          options={{ headerShown: false }}
        />
        <Stack.Screen
          name="LuasJG"
          component={LuasJG}
          options={{ headerShown: false }}
        />
        <Stack.Screen
          name="KelilingJG"
          component={KelilingJG}
          options={{ headerShown: false }}
        />
        <Stack.Screen
          name="Trapesium"
          component={Trapesium}
          options={{ headerShown: false }}
        />
        <Stack.Screen
          name="LuasTrapesium"
          component={LuasTrapesium}
          options={{ headerShown: false }}
        />
        <Stack.Screen
          name="KelilingTrapesium"
          component={KelilingTrapesium}
          options={{ headerShown: false }}
        />
        <Stack.Screen
          name="Lingkaran"
          component={Lingkaran}
          options={{ headerShown: false }}
        />
        <Stack.Screen
          name="LuasLingkaran"
          component={LuasLingkaran}
          options={{ headerShown: false }}
        />
        <Stack.Screen
          name="KelilingLingkaran"
          component={KelilingLingkaran}
          options={{ headerShown: false }}
        />
        <Stack.Screen
          name="Kubus"
          component={Kubus}
          options={{ headerShown: false }}
        />
        <Stack.Screen
          name="VolumeKubus"
          component={VolumeKubus}
          options={{ headerShown: false }}
        />
        <Stack.Screen
          name="LPKubus"
          component={LPKubus}
          options={{ headerShown: false }}
        />
        <Stack.Screen
          name="Balok"
          component={Balok}
          options={{ headerShown: false }}
        />
        <Stack.Screen
          name="VolumeBalok"
          component={VolumeBalok}
          options={{ headerShown: false }}
        />
        <Stack.Screen
          name="LPBalok"
          component={LPBalok}
          options={{ headerShown: false }}
        />
        <Stack.Screen
          name="Tabung"
          component={Tabung}
          options={{ headerShown: false }}
        />
        <Stack.Screen
          name="Kerucut"
          component={Kerucut}
          options={{ headerShown: false }}
        />
        <Stack.Screen
          name="Bola"
          component={Bola}
          options={{ headerShown: false }}
        />
      </Stack.Navigator>
    </NavigationContainer>
  );
};
export default App;
